import logo from './logo.svg';
import './App.css';

import NestedModal from './2components2/popup.js';
import SignUp from './components/Pages/Signup.js';
import StickyFooter from './2components2/footer.js';
import PrimarySearchAppBar from './2components2/header.js';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import SignIn from './components/Pages/Signin.js';
import MyButton from './useless/clickehero.js';




function App() {
  return (
    <div className="App">
      <div className='App-body'>
      <BrowserRouter>
        <Routes>
        <Route path='/' element={<MyButton />}></Route>
        <Route path='/login/' element={<SignIn />}></Route>
        <Route path='/sign/' element={<SignUp />}></Route>
        </Routes>
      </BrowserRouter>


      </div>


      <body className="App-Testing">
        <p>HELLO</p>

        <NestedModal />


      </body>

      <header className='App-header'>
      <PrimarySearchAppBar />
      <img src={logo} className="App-logo" alt="logo" />
      </header>

      <footer className='App-footer'>
        <StickyFooter />
      </footer>

    </div>

  );
}

export default App;
